    if (props.items.length === 0) {
        return <h2 className='expenses-list__fallback'>Found no expenses.</h2>;}
return(

    <Card className="Birthday_List">
        
        {props.birthdayCard.map(card => <BirthdayItem/>
)}
       

       </Card>
    
);

}

export default BirthdayList;
